package com.logibeat.cloud.core.dto;import com.fasterxml.jackson.annotation.JsonIgnoreProperties;import com.logibeat.cloud.util.tools.pageMdl.Page;import java.util.List;/** * 任务类型数据传输对象 * Created by Yujinjun on 2016/5/12. */@JsonIgnoreProperties(ignoreUnknown = true)public class TaskDto extends Page {    /**     * 当前用户     */    private String personId;    /**     * 司机端所选的企业id     */    private String entId;    /**     * 车辆Id     */    private String carId;    /**     * 车牌号     */    private String plateNumber;    /**     * gps信息     */    private GpsShortInfoDto gps;    /**     * 网点列表     */    private List<TaskOrdersAreaDto> areaList;    /**     * 行程开始时间     */    private String startTime;    /**     * 行程结束时间     */    private String endTime;    /**     * 任务时效     */    private Integer Statute;    /**     * 起始网点id     */    private String startNetId;    /**     * 结束网点id     */    private String endNetId;    /**     * 是否在指定发车点     * @return     */    private Integer isAtPoint;    /**     * 发行程图片     */    private String picUrls;    /**     * 备注     */    private String remark;    public String getPersonId() {        return personId;    }    public void setPersonId(String personId) {        this.personId = personId;    }    public String getEntId() {        return entId;    }    public void setEntId(String entId) {        this.entId = entId;    }    public String getCarId() {        return carId;    }    public void setCarId(String carId) {        this.carId = carId;    }    public String getPlateNumber() {        return plateNumber;    }    public void setPlateNumber(String plateNumber) {        this.plateNumber = plateNumber;    }    public GpsShortInfoDto getGps() {        return gps;    }    public void setGps(GpsShortInfoDto gps) {        this.gps = gps;    }    public List<TaskOrdersAreaDto> getAreaList() {        return areaList;    }    public void setAreaList(List<TaskOrdersAreaDto> areaList) {        this.areaList = areaList;    }    public String getStartTime() {        return startTime;    }    public void setStartTime(String startTime) {        this.startTime = startTime;    }    public String getEndTime() {        return endTime;    }    public void setEndTime(String endTime) {        this.endTime = endTime;    }    public Integer getStatute() {        return Statute;    }    public void setStatute(Integer statute) {        Statute = statute;    }    public String getStartNetId() {        return startNetId;    }    public void setStartNetId(String startNetId) {        this.startNetId = startNetId;    }    public String getEndNetId() {        return endNetId;    }    public void setEndNetId(String endNetId) {        this.endNetId = endNetId;    }    public Integer getIsAtPoint() {        return isAtPoint;    }    public void setIsAtPoint(Integer isAtPoint) {        this.isAtPoint = isAtPoint;    }    public String getPicUrls() {        return picUrls;    }    public void setPicUrls(String picUrls) {        this.picUrls = picUrls;    }    public String getRemark() {        return remark;    }    public void setRemark(String remark) {        this.remark = remark;    }}